import React, { useState } from 'react'
import axios from 'axios'

function Side_work() {
  const [userdata, setuserdata] = useState([])

  const fetchdata = async () => {
    const res = await axios.get("https://picsum.photos/v2/list?page=2&limit=100")
    setuserdata(res.data)
  }

  let printdata = "user not found"

  if (userdata.length > 0) {
    printdata = userdata.map((elem, index) => {
      return (
        <div 
          key={elem.id}
          style={{
            position: "relative",
            width: "260px",
            margin: "15px",
            textAlign: "center"
          }}
        >
          
          {/* ID Badge (inline CSS) */}
          <p
            style={{
              position: "absolute",
              top: "8px",
              left: "8px",
              background: "rgba(0,0,0,0.7)",
              padding: "5px 10px",
              borderRadius: "5px",
              color: "white",
              margin: 0,
              fontSize: "14px",
              fontWeight: "bold",
              zIndex: 10
            }}
          >
            {index + 1}
          </p>

          {/* Image */}
          <img
            src={elem.download_url}
            alt="img"
            style={{
              width: "250px",
              height: "250px",
              objectFit: "cover",
              borderRadius: "10px"
            }}
          />

          <h4 style={{ marginTop: "10px" }}>{elem.author}</h4>
        </div>
      )
    })
  }

  return (
    <div className='bg-dark text-white text-center w-100' style={{ minHeight: "100vh" }}>
      <button className='btn btn-danger m-5' onClick={fetchdata}>
        GetData
      </button>

      <div className='d-flex flex-wrap justify-content-center'>
        {printdata}
      </div>
      <div className='=d-flex justify-content-center'>
        <button className='btn btn-danger'>
          Next
        </button>
        <button className='btn btn-danger '>
          Previous
        </button >

      </div>
    </div>
  )
}

export default Side_work
